import React from 'react';
import "./App.css";
import {Routes, Route, Navigate} from 'react-router-dom';
import Home from './components/pages/Home';
import Tourse from './components/pages/Tourse';
import TourDetails from './components/pages/TourDetails';
import Login from './components/pages/Login';
import Register from './components/pages/Register';
import SearchResultList from './components/pages/SearchResultList';
import Header from './components/Header/Header';
 
const App = () => {
  return (
    <> 
    <Header/>
    <Routes>

           {/* <Route path='/' element={<Navigate to='/home'></Navigate>} />  */}

            <Route path="/home" element={<Home/>} />
            <Route to="/tours" element={<Tourse/>} />
            <Route to="/tours/:id" element={<TourDetails/>} />
            <Route to="/login" element={<Login/>} />
            <Route to="/register" element={<Register/>} />
            <Route to="/tours/search" element={<SearchResultList/>} />
 
        
           


        </Routes>

        </>
  );
};

export default App;
